import React, { Container , Button } from 'react';
import { useNavigate } from 'react-router-dom';

function Appointments() {

    const navigate = useNavigate();

    return (
        <Container fluid>
            <Container className='text-center'>
                <h1 className='header'>DocTalk</h1>
                <h3 className='subheader'>Your online medical appointments. Click below to view your appointments.</h3>
                {/* <Button variant='info' classname="mt-3" onClick={() => navigate("/")}>View Appointments</Button>     */}
            </Container>
        </Container>
    );

}

export default Appointments;
